function Home(props) {
    console.log(props)

    return (
      <div>
          <div>
        <div>
          <h3>our best offers Games</h3>
          {props.games.map(game => (
              <div>
                  <img src={game.photo} alt=""/>
                  <h2>{game.title}</h2>
              </div>
          ))}
        </div>
      </div>
      <div>
      <div>
        <h3>our best offers Games</h3>
          {props.consoles.map(consol => (
              <div>
                  <img src={consol.photo} alt=""/>
                  <h2>{consol.title}</h2>
              </div>
          ))}
        </div>
      </div>
      </div>

    )
}

export default Home;
